    public partial class Order : Form
    {
        DataOperation objDataOperation;
        public int customerId = 0;
        public Order(bool isWholesale, string subTotal, string orderTotal, string discount, string orderId, string customer,string mobile,string address, double payment,int customerId)
        {
            objDataOperation = new DataOperation();
            InitializeComponent();
            lblTotal.Text = orderTotal;
            lblSubTotal.Text = subTotal;
            lblDiscount.Text = discount;
            LoadGVItems(isWholesale);
            cbPaymentMethod.SelectedItem = "Cash";
            cbPaymentStatus.SelectedItem = "Due";
            lblOrder.Text = orderId;
            txtCustomer.Text = customer;
            txtAddress.Text = address;
            txtMobile.Text = mobile;
            txtCash.Text = payment.ToString();
            if(orderId != string.Empty)
            {
                lblPayment.Text = "Paid";
                lblPaymentStatus.Visible = false;
                cbPaymentStatus.Visible = false;
                txtCash.ReadOnly = true;
                this.customerId = customerId;
            }
        }
        private void LoadGVItems(bool isWholesale)
        {
            gvItems.DataSource = SaleRegister.dtGVItems;
           
            if (isWholesale)
            {
                gvItems.Columns["Price"].Visible = false;
                gvItems.Columns["WholeSalePrice"].Visible = true;
                gvItems.Columns["SubTotal"].Visible = false;
                gvItems.Columns["WholeSaleSubTotal"].Visible = true;
            }
            else
            {
                gvItems.Columns["Price"].Visible = true;
                gvItems.Columns["WholeSalePrice"].Visible = false;
                gvItems.Columns["SubTotal"].Visible = true;
                gvItems.Columns["WholeSaleSubTotal"].Visible = false;
            }
        }
        private void txtPlaceOrder_Click(object sender, EventArgs e)
        {
            var confirmResult = MessageBox.Show("Are you sure to place this order ??",
                                     "Confirm Order!!",
                                     MessageBoxButtons.YesNo);
            if (confirmResult == DialogResult.Yes)
            {
                string res = objDataOperation.ExecuteOrderDetails(txtCustomer.Text.Trim(),
                                                           txtAddress.Text.Trim(),
                                                           txtMobile.Text.Trim(),
                                                           lblTotal.Text.Trim(),
                                                           lblSubTotal.Text.Trim(),
                                                           lblDiscount.Text.Trim(),
                                                           SaleRegister.dtGVItems,
                                                           gvItems.Columns["WholeSalePrice"].Visible,
                                                           cbPaymentStatus.Text,
                                                           cbPaymentMethod.Text,
                                                           txtCard.Text.Trim(),
                                                           txtCash.Text.Trim(),
                                                           dtPickerExpectedPayment.Value,
                                                           lblOrder.Text,
                                                           customerId);
                if (res.Substring(0, 1) == "1")
                {
                    
                    try
                    {
                        string htmlCode = CreateHtmlOrderDetails(res.Split('-')[1]);
                        WebBrowserPrint objPrint = new WebBrowserPrint(htmlCode);
                        this.Hide();
                        objPrint.ShowDialog();
                        SaleRegister.dtGVItems.Clear();
                        this.Close();
                    }
                    catch  { }
                }
                else
                {
                    MessageBox.Show(res);
                }
            }
        }
