        private void txtCancel_Click(object sender, EventArgs e)
        {
            this.Close();
        }

        private void cbPaymentStatus_SelectedIndexChanged(object sender, EventArgs e)
        {
            if(cbPaymentStatus.Text=="Due")
            {
                lblPaymentDate.Visible = true;
                dtPickerExpectedPayment.Visible = true;
                txtCash.Text = "0.00";
                txtCash.Enabled = true;
            }
            else
            {
                lblPaymentDate.Visible = false;
                dtPickerExpectedPayment.Visible = false;
                txtCash.Text = lblTotal.Text;
                txtCash.Enabled = false;
            }
        }

        private void cbPaymentMethod_SelectedIndexChanged(object sender, EventArgs e)
        {
            if (cbPaymentMethod.Text == "Card")
            {
                txtCard.Visible = true;
            }
            else
            {
                txtCard.Visible = false;
            }
        }

        private void btnLoad_Click(object sender, EventArgs e)
        {
            if(txtSearchCustomer.Text.Trim()!=string.Empty)
            {
                string query = "exec [desktop].GetCustomerDetails @keyWord='"+ txtSearchCustomer.Text.Trim() + "'";
                DataTable dt = objDataOperation.GetDataTable(query);
                if (dt != null)
                {
                    if (dt.Rows.Count != 0)
                    {
                        customerId = Convert.ToInt32(dt.Rows[0]["CustomerID"].ToString());
                        txtCustomer.Text = dt.Rows[0]["CustomerName"].ToString();
                        txtAddress.Text = dt.Rows[0]["CustomerAddress"].ToString();
                        txtMobile.Text = dt.Rows[0]["CustomerMobileNo"].ToString();
                    }
                    else
                    {
                        customerId = 0;
                        txtCustomer.Text = string.Empty;
                        txtAddress.Text = string.Empty;
                        txtMobile.Text = string.Empty;
                    }
                }
                else
                {
                    MessageBox.Show("Invalid Customer");
                }
            }
        }
    }
